import LandingPage from "../pages/LandingPage";
import Login from "../pages/Login";

const routes = [
  {
    path: "/",
    element: <LandingPage />,
  },
  {
    path: "/dashboard",
    element: <Dashboard />,
  },
  {
    path: "/login",
    element: <Login />
  }
];

export default routes
